import React from "react";
import { Routes, Route } from "react-router-dom";
import Product from "../Product/Product";
import Cart from "../front/Cart/Cart";
function Router({ productItems, items, handleadd,handleremove}) {
  return (
    <div>
      <Routes>
        <Route
          path="/"
          element={
            <Product productItems={productItems} handleadd={handleadd} />
          }
        ></Route>
        <Route
          path="/cart"
          element={<Cart items={items} handleadd={handleadd} handleremove />}
        ></Route>
      </Routes>
    </div>
  );
}

export default Router;
